CREATE PROCEDURE dbo.proc_transform_336
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_336
    SET payload = LEFT(payload, 1000) + N'|V4-336|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_336;
END
